import "./booleanPopUp_style.css"

function booleanPopUp(props) {

    return (

        <div className="pop-up">
            <div className="popup-content">
            
                <p>{props.message}</p>

                <div className="painel-btns">
                    <button onClick={props.setAnswer(true)}>{props.trueBtn}</button>
                    <button onClick={props.setAnswer(false)}>{props.falseBtn}</button>
                </div>
            
            
            </div>
        </div>
    )
}

export default booleanPopUp;
